import React from "react";
import * as style from "./styles";

function Home() {
  return (
    <style.Container>
      <style.mainContainer>
        <style.mainImg src="/images/home/homeImg.png" />
        <style.mainText></style.mainText>
      </style.mainContainer>
    </style.Container>
  );
}
export default Home;
